if(window.sessionStorage){let e=document.querySelectorAll("[id]");for(let t=0,l=e.length;t<l;t++){let l=e[t].getAttribute("id");e[t].value=sessionStorage.getItem(l)||e[t].value,e[t].onkeyup=function(){sessionStorage.setItem(l,e[t].value)}}}function ValidCheckAdd(){let e=document.getElementById("partName"),t=document.getElementById("validerror");""===e.value?document.getElementById("content")?t.style.display="inline-flex":(t.style.display="flex",t.style.justifyContent="center"):t.style.display="none"}function ValidCheckChange(){let e=document.getElementById("newName"),t=document.getElementById("validerror");""===e.value?document.getElementById("newContent")?t.style.display="inline-flex":(t.style.display="flex",t.style.justifyContent="center"):t.style.display="none"}function RemoveStorage(){let e=document.querySelectorAll("[id]");for(let t=0,l=e.length;t<l;t++){let l=e[t].getAttribute("id");sessionStorage.removeItem(l)}}